INSERT INTO "shoppe_products" VALUES(7,NULL,1,'Casual Eclectic','1000100','casual-eclectic','A high style living room with walnut and neutral finishes complemented by chrome and glass pieces to create an eclectic style. Every piece is durable and functional, allowing a casual lifestyle. ','A casual eclectic living room','f',0,0,0,NULL,'2015-05-09 02:29:04.227243','2015-05-09 02:42:33.152143','t','This room comes in three tiers, offering essential and design pieces for three levels of living.','f','f');
INSERT INTO "shoppe_products" VALUES(8,7,NULL,'The Bare Minimum','1000101','casual-electic-bare',NULL,NULL,'f',0,1499,0,1,'2015-05-09 02:39:08.364008','2015-05-09 03:08:08.232518','f','The Bare Minimum option has the essential furniture to make a living room functional: a sofa, coffee table and TV stand.','f','f');
INSERT INTO "shoppe_products" VALUES(9,7,NULL,'Full Style & Function','1000201','casual-electic-full',NULL,NULL,'f',0,1999,0,1,'2015-05-09 02:39:40.574429','2015-05-09 03:07:43.808595','f','The Full Style & Function option has all the essential furniture as well as occasional and accent furniture to make a living room an interior design feature. It has a sofa, coffee table, TV stand, side table, lighting and area rug.','f','t');
INSERT INTO "shoppe_products" VALUES(10,7,NULL,'Plus One','1000301','casual-electic-plus',NULL,NULL,'f',0,2499,0,1,'2015-05-09 02:40:14.632045','2015-05-09 03:07:52.570104','f','The Plus One option means it is a ''Full Style & Function'' room plus another room. It is intended to occupy a large living space with more than one function in that space. This option includes everything in a stylish and functional living room as well as a dining room. The included furniture are: a sofa, coffee table, TV stand, side table, lighting, area rug, dining table and four dining chairs. ','f','f');
